import styles from "./../../assets/views/popups/InfoLogSpring.module.css";

function InfoLogSpring({lines}){
    return (
        <div className={styles.containerInfoLogSpring}>
            {lines.map((line, key) => {
                return (
                    <p key={index}>
                        {line}
                    </p>
                )
            })}
        </div>
    )
}

export default InfoLogSpring;
